import React, { useState } from "react"

  const SearchUser = () => {
    const [users, setUsers] = useState([])

    const fetchData = e => {
      const query = e.target.value
      fetch(`https://sheet.best/api/sheets/6fac28fb-d646-4dcf-b171-00f0c29a5df7/name/${query}`)
        .then(response => {
          return response.json()
        })
        .then(data => {
          setUsers(data)
        })
    }

  return (
    <div className='tablecontainer'> 
    <input onChange={fetchData} label="Search User" />
    {users.length > 0 && (
<table> 
{users.map(user => (
            <caption>{user.name}</caption> ))}
           {users.map(user => (
           <caption>{user.dept}</caption>))}



    <tr> 
        <th class="border1"></th>
        <th></th> 
        <th>Mark</th> 

    </tr> 

    <tr> 
        <th rowspan="3">Skill Training</th> 
        <th>Foundation Course</th> 
        {users.map(user => ( 
        <th>{users.fc}</th> 
        ))}
    </tr> 
    <tr> 
        <th>Technical Course / FIS</th> 
        {users.map(user => ( 
        <th>{users.tc}</th> 
        ))}
    </tr> 
    <tr> 
        <th>Faculty Interview</th> 
        {users.map(user => ( 
        <th>{users.interview}</th> 
        ))}
    </tr>
    <tr> 
        <th rowspan="4">Resource Utilization/Industry Relationship</th> 
        <th>Online Courses</th> 
        {users.map(user => ( 
        <th>{users.oc}</th> 
        ))}
    </tr> 
    <tr> 
        <th>Internship</th> 
        {users.map(user => ( 
        <th>{users.internship}</th> 
        ))}
    </tr> 
    <tr> 
        <th>In plant Training</th> 
        {users.map(user => ( 
        <th>{users.ipt}</th> 
        ))}
    </tr>
    <tr> 
        <th>Interaction with HR</th> 
        {users.map(user => ( 
        <th>{users.ihr}</th> 
        ))}
    </tr>
    <tr> 
        <th rowspan="6">Student Achievements</th> 
        <th>Project Presentation</th> 
        {users.map(user => ( 
        <th>{users.projectp}</th> 
        ))}
    </tr> 
    <tr> 
        <th>Paper Presentation</th> 
        {users.map(user => ( 
        <th>{users.paperp}</th> 
        ))}
    </tr> 
    <tr> 
        <th>Journal Publications</th> 
        {users.map(user => ( 
        <th></th> 
        ))}
    </tr>
    <tr> 
        <th>Patent</th> 
        {users.map(user => ( 
        <th>-</th> ))}

    </tr>
    <tr> 
        <th>Consultancy</th> 
        {users.map(user => ( 
        <th>-</th> 
        ))}
    </tr>
    <tr> 
        <th>Product Development</th> 
        {users.map(user => ( 
        <th>-</th> 
        ))}
    </tr>
    <tr> 
        <th rowspan="4">Add On Activities</th> 
        <th>Assignment Series</th> 
        {users.map(user => ( 
        <th>20</th> 
        ))}
    </tr> 
    <tr> 
        <th>Video Logs </th> 
        {users.map(user => ( 
        <th>-</th> 
        ))}
    </tr> 
    <tr> 
        <th>Sports Activities</th> 
        {users.map(user => ( 
        <th>100</th> 
        ))}
    </tr>
    <tr> 
        <th>Outreach Activities</th> 
        {users.map(user => ( 
        <th>10</th> 
        ))}
    </tr>
</table>
)}
</div>
  )
}
export default SearchUser
